import react, { Component } from "react";
import PropTypes from 'prop-types';


class Button extends Component {

    constructor (){
        super(); 
        
    }

    onClick(){
        console.log("hi")
    }

    render() {
        return (
            <button onClick={this.onClick} style={{backgroundColor : this.props.color}} className="btn nav-item text-white">{this.props.text}</button>


        );
    }
   
}
Button.propTypes = {
    color: PropTypes.string,
    text: PropTypes.string
};
Button.defaultProps={
    color : "green", 
    text : "Add"
};
export default Button;
